import UserContext from "../context/UserContext";
import { useContext } from "react";
function ChangeUser() {
  const { user, setUser } = useContext(UserContext);
  return (
    <button onClick={() => setUser(user === "mici" ? "Ira" : "mici")}>
      Change User
    </button>
  );
}

export default ChangeUser;
